import React from 'react';
import { useNavigate } from 'react-router-dom';
import'./Weddingcard.css';

const cardData = [
  {
    image: "https://th.bing.com/th/id/OIP.UOOfzDdCC_RNNHn4xY-7PwHaIl?rs=1&pid=ImgDetMain",
    title: "Entrance Gate"
    
  },
  {
    image: "",
    title: "Stage Decor"
  },
  {
    image: "https://i.pinimg.com/736x/cc/05/02/cc0502924e7011af896800b63bf59767.jpg",
    title: "Naming Decor"
    
  },
  
];

function Namingcard() {
  const navigate = useNavigate();

  const handleCardClick = (path) => {
    navigate(path);
  };

  return (
    <div className='card-container'>
      {cardData.map((card, index) => (
        <div
          key={index}
          className='card'
          onClick={() => handleCardClick(card.path)}
          style={{ cursor: 'pointer' }}
        >
          <img src={card.image} alt={card.title} className='card-image' />
          <div className="card-content">
            <h3 className='card-title'>{card.title}</h3>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Namingcard;
